export class Login {
  constructor(id, usuario, contrasenia, idPersona) {
    this.id = id;
    this.usuario = usuario;
    this.contrasenia = contrasenia;
    this.idPersona = idPersona;
  }

  get getId() {
    return this.id;
  }

  get getUsuario() {
    return this.usuario;
  }

  get getContrasenia() {
    return this.contrasenia;
  }

  get getIdPersona() {
    return this.idPersona;
  }

}
